using System;
using System.Drawing;
using System.IO;

namespace TechConnect
{
    public class Image64
    {
        public const string Corredores = "";
        public const string ProfileDefault = "";
        public const string Menu = "";
        public const string MenuHomePage = "";
        public const string MenuRegister = "";
        public const string MenuDashboard = "";
        public const string MenuStatusCatraca = "";
        public const string MenuBuildWorkout = "";
        public const string MenuConfiguration = "";
        public const string MenuExit = "";
        public const string Halter = "";
        public const string NoHalter = "";

        public const string Edit = "";
        public const string Ok = "";
        public const string Ng = "";
        public const string Next = "";
        public const string Previous = "";

        public const string Filter = "";
        public const string RemoveAt = "";
        public const string Insert = "";

        public static Image Base64ToImage(string imageBase64)
        {
            return Image.FromStream(new MemoryStream(Convert.FromBase64String(imageBase64)));
        }

        /// <summary>
        /// Converte de Image para byte array
        /// </summary>
        /// <param name="imageIn">Image</param>
        /// <returns>byte array</returns>
        public static byte[] ImageToByteArray(System.Drawing.Image imageIn)
        {
            MemoryStream ms = new MemoryStream();
            imageIn.Save(ms, System.Drawing.Imaging.ImageFormat.Gif);
            return ms.ToArray();
        }

        /// <summary>
        /// Converte de byte array para Image
        /// </summary>
        /// <param name="byteArrayIn">Imagem byte array</param>
        /// <returns>Image</returns>
        public static Image ByteArrayToImage(byte[] byteArrayIn)
        {
            MemoryStream ms = new MemoryStream(byteArrayIn);
            Image returnImage = Image.FromStream(ms);
            return returnImage;
        }

        /// <summary>
        /// Compara dois image
        /// </summary>
        /// <param name="Imagem1">Image</param>
        /// <param name="Imagem2">Image</param>
        /// <returns>Boolean (true) se as imagens forem iguais e (false) se as imagens forem diferentes</returns>
        public static Boolean ComparaImagem(System.Drawing.Image Imagem1, System.Drawing.Image Imagem2)
        {
            if (ImageToByteArray(Imagem1) == ImageToByteArray(Imagem2))
            {
                return true;
            }

            return false;
        }

        /// <summary>
        /// Compara dois image convertidos em byte array 
        /// </summary>
        /// <param name="Imagem1">byte array de uma imagem</param>
        /// <param name="Imagem2">byte array de uma imagem</param>
        /// <returns>Boolean (true) se as imagens forem iguais e (false) se as imagens forem diferentes</returns>
        public static Boolean ComparaImagem(byte[] Imagem1, byte[] Imagem2)
        {
            if (Imagem1 == Imagem2)
            {
                return true;
            }

            return false;
        }
    }

}
